import ReactDOM from 'react-dom';

ReactDOM.render(
  <React.Fragment>
  <h1> ALLAH </h1>
  <p>The React website</p>
  <p>This is frontend</p>
  </React.Fragment>
  ,
  document.getElementById("root")

);
